const Calculator = () => {
  const [display, setDisplay] = useState('0');
  const [expression, setExpression] = useState('');
  const [showConfetti, setShowConfetti] = useState(false);

  const handleNumberClick = (number) => {
    setDisplay((prevDisplay) => {
      if (prevDisplay === '0') {
        return number;
      }
      return prevDisplay + number;
    });
    setExpression((prevExpression) => prevExpression + number);
  };

  const handleOperatorClick = (operator) => {
    if (expression.endsWith('+') || expression.endsWith('-') || expression.endsWith('*') || expression.endsWith('/')) {
      setExpression(expression.slice(0, -1) + operator);
    } else {
      setExpression(expression + operator);
    }
    setDisplay(operator);
  };

  const handleFunctionClick = (func) => {
    if (func === 'sin') {
      setExpression(expression + 'Math.sin(');
    } else if (func === 'cos') {
      setExpression(expression + 'Math.cos(');
    } else if (func === 'tan') {
      setExpression(expression + 'Math.tan(');
    } else if (func === 'log') {
      setExpression(expression + 'Math.log10(');
    } else if (func === 'exp') {
      setExpression(expression + 'Math.exp(');
    } else if (func === 'sqrt') {
      setExpression(expression + 'Math.sqrt(');
    } else if (func === 'factorial') {
      setExpression(expression + 'factorial(');
    } else if (func === 'rand') {
      setExpression(expression + 'Math.random()');
    } else if (func === 'deg') {
      setExpression(expression + 'deg(');
    } else if (func === 'rad') {
      setExpression(expression + 'rad(');
    }
    setDisplay(func);
  };

  const handleEqualClick = () => {
    try {
      let result = eval(expression);
      if (expression.includes('5') && expression.includes('6')) {
        setShowConfetti(true);
        setTimeout(() => setShowConfetti(false), 2000);
      }
      setDisplay(result.toString());
      setExpression(result.toString());
    } catch (error) {
      setDisplay('Error');
      setExpression('');
    }
  };

  const handleClearClick = () => {
    setDisplay('0');
    setExpression('');
  };

  const handleBackspaceClick = () => {
    if (expression.length > 0) {
      setExpression(expression.slice(0, -1));
      setDisplay(expression.slice(0, -1));
    } else {
      setDisplay('0');
      setExpression('');
    }
  };

  return (
    <div className="calculator">
      {showConfetti && <ConfettiExplosion />}
      <div className="display">{display}</div>
      <div className="buttons">
        <button onClick={() => handleNumberClick('7')}>7</button>
        <button onClick={() => handleNumberClick('8')}>8</button>
        <button onClick={() => handleNumberClick('9')}>9</button>
        <button onClick={() => handleOperatorClick('/')}>/</button>
        <button onClick={() => handleNumberClick('4')}>4</button>
        <button onClick={() => handleNumberClick('5')}>5</button>
        <button onClick={() => handleNumberClick('6')}>6</button>
        <button onClick={() => handleOperatorClick('*')}>*</button>
        <button onClick={() => handleNumberClick('1')}>1</button>
        <button onClick={() => handleNumberClick('2')}>2</button>
        <button onClick={() => handleNumberClick('3')}>3</button>
        <button onClick={() => handleOperatorClick('-')}>-</button>
        <button onClick={() => handleNumberClick('0')}>0</button>
        <button onClick={() => handleNumberClick('.')}>.</button>
        <button onClick={() => handleOperatorClick('+')}>+</button>
        <button onClick={() => handleFunctionClick('sin')}>sin</button>
        <button onClick={() => handleFunctionClick('cos')}>cos</button>
        <button onClick={() => handleFunctionClick('tan')}>tan</button>
        <button onClick={() => handleFunctionClick('log')}>log</button>
        <button onClick={() => handleFunctionClick('exp')}>exp</button>
        <button onClick={() => handleFunctionClick('sqrt')}>sqrt</button>
        <button onClick={() => handleFunctionClick('factorial')}>!</button>
        <button onClick={() => handleFunctionClick('rand')}>rand</button>
        <button onClick={() => handleFunctionClick('deg')}>deg</button>
        <button onClick={() => handleFunctionClick('rad')}>rad</button>
        <button onClick={handleEqualClick}>=</button>
        <button onClick={handleClearClick}>C</button>
        <button onClick={handleBackspaceClick}>Backspace</button>
      </div>
    </div>
  );
};

export default Calculator;
